const t=JSON.parse('{"key":"v-a9266534","path":"/reading/algorithm/algorithms_in_c_part_1-4/01_fundamentals/01.1.html","title":"1.1 Algorithms","lang":"zh-CN","frontmatter":{"title":"1.1 Algorithms","date":"2022-01-20T00:00:00.000Z","category":["algorithm","clang"],"timeline":true},"headers":[],"readingTime":{"minutes":0.75,"words":225},"filePathRelative":"reading/algorithm/algorithms_in_c_part_1-4/01_fundamentals/01.1.md","localizedDate":"2022年1月20日","excerpt":"<p>The term <em>Algorithm</em> is used in computer science to describe a problem-solving method suitable for implementation as a computer program. It is the method, rather than the computer program itself, that we must study to learn how the problem is being attacked.</p>\\n<p>Most algorithms of interest involve methods of organizing the data involved in the computation. Objects created in this way are called <em>data structures</em>, and they also are central objects of study in computer science. Thus, algorithms and data structures go hand in hand.</p>"}');export{t as data};
